function editText(text) {
    while (
        text.indexOf("ё") > -1 ||
        text.indexOf("Ё") > -1 ||
        text.indexOf("«") > -1 ||
        text.indexOf("»") > -1 ||
        text.indexOf(" - ") > -1
    ) {
        text = text.replace('ё', 'е')
        text = text.replace('Ё', 'Е')
        text = text.replace('«', '"')
        text = text.replace('»', '"')
        text = text.replace(' - ', ' – ')
    }
    text = text.replace(/^\s+|\s+$/g, '')
    while (text.indexOf('  ') > -1) {
        text = text.replace('  ', ' ')
    }
    return text
}


